@testable import GitHub_Browser

class RestAPITests: XCTestCase {

    override func setUp() {
        // Put setup code here. This method is called before the invocation of each test method in the class.
    }

    override func tearDown() {
        // Put teardown code here. This method is called after the invocation of each test method in the class.
    }

    func testCommitResponseParsing() {
        let data = Data.commitQueryResponse
        let cleaned = data.removingControlCharacters()
        var response: [CommitResponseV3]?
        do {
            response = try JSONDecoder().decode([CommitResponseV3].self, from: cleaned)
        } catch let error {
            print(error)
        }
        XCTAssertNotNil(response)
        
        // This is an example of a functional test case.
        // Use XCTAssert and related functions to verify your tests produce the correct results.
    }
}

